import React, { Component } from 'react';
import './App.css';
import Background from './images/back.jpg'

class App extends Component {
  render() {
    return (
        <div className="App">
            <div id="navigation"></div>
            <header className="App-header" id="App-header" style={{backgroundImage: "url(" + require("./images/back.jpg") + ")"}}>

            </header>
        </div>
    );
  }
}

export default App;
